## Answer (0)

You can use a `useEffect` to close the tooltip when the content changes. This will ensure that only one tooltip is open at a time.

```
import React, { useEffect } from 'react';
import { useTooltip } from '../context/TooltipContext';

const Tooltip = ({ text, children }) => {
  const { isOpen, content, openTooltip, closeTooltip } = useTooltip();

  useEffect(() => {
    if (isOpen && content !== text) {
      closeTooltip();
    }
  }, [isOpen, content, text, closeTooltip]);

  return (
    <div
      onMouseEnter={() => openTooltip(text)}
      onMouseLeave={closeTooltip}
      onClick={closeTooltip}
    >
      {children}
      {isOpen && content === text && (
        <div className="tooltip">
          <p>{content}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
